import { TextField } from "@material-ui/core";
export default function Navbar() {
  return (
    <div>
      <div>
        <img src="./assets/Logo.png" />
        <TextField
          variant="outlined"
          size="small"
          placeholder="Search a song of your choice"
        />
      </div>
    </div>
  );
}
